import React ,{memo} from 'react'

import Image from '../atoms/Image';
import Card from '../molecules/Card';
import axios from 'axios';
import useSWR from 'swr';
const Home = memo(()=>{

    const CLIENT_ID = '0Z-LBq4hNinGRglNGQpYef33VyodRl1K012Ai9dJd18';
    const URL = `https://api.unsplash.com/photos?page=1&per_page=10&client_id=${CLIENT_ID}`

    const {data} = useSWR(URL,(url:string)=>axios(url).then(res=>res.data));

return(

<>
{data && data?.forEach(((item: any)=>{
    <>
{console.log(item.urls.regular)}
    <Card>
    <Image href={'https://images.unsplash.com/photo-1569389397653-c04fe624e663?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwyMjM5MzJ8MXwxfGFsbHwxfHx8fHx8Mnx8MTYxODY1MDAyNg&ixlib=rb-1.2.1&q=80&w=1080'} height={400} width={300}/>
</Card>
</>

}))}



</>
)
})
export default Home;
